import React from "react";
import MainLayout from "./layout/MainLayout";

import { Route, Switch } from "react-router-dom";
import Home from "./pages/Home";
import Project from "./pages/Project";
import Solution from "./pages/Solution";
import About from "./pages/About";
import Contact from "./pages/Contact";

const AppRoute = ({ component: Component, layout: Layout, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) => {
        return (
          <Layout>
            <Component {...props}></Component>
          </Layout>
        );
      }}
    ></Route>
  );
};

const App = () => {
  return (
    <Switch>
      <AppRoute path="/" exact layout={MainLayout} component={Home} />
      <AppRoute path="/Project" layout={MainLayout} component={Project} />
      <AppRoute path="/Solution" layout={MainLayout} component={Solution} />
      <AppRoute path="/About" layout={MainLayout} component={About} />
      <AppRoute path="/Contact" layout={MainLayout} component={Contact} />
    </Switch>
  );
};

export default App;
